import { styled } from "styled-components";
import TypeHotelItem from "./components/TypeHotelItem";
import dataType from ".././../../../data/type.json";

const StyledTypeHotelList = styled.div`
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;

  & h2 {
    width: 100%;
    padding: 30px 0px;
  }
`;
export default function TypeHotelListItem() {
  return (
    <StyledTypeHotelList>
      <h2>Browse by property type</h2>
      {dataType.map((item) => (
        <TypeHotelItem name={item.name} count={item.count} image={item.image} />
      ))}
    </StyledTypeHotelList>
  );
}
